import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

function BookingHistory() {
    const [activeTab, setActiveTab] = useState('active');

    // Mock booking data
    const bookings = {
        active: [
            {
                id: 1,
                parkingName: "Central Plaza Parking",
                spotNumber: "A-123",
                startTime: "2025-02-26T14:00:00",
                endTime: "2025-02-26T18:00:00",
                price: "20.00",
                status: "active"
            }
        ],
        upcoming: [
            {
                id: 2,
                parkingName: "City Mall Parking",
                spotNumber: "B-456",
                startTime: "2025-03-01T10:00:00",
                endTime: "2025-03-01T15:00:00",
                price: "25.00",
                status: "upcoming"
            }
        ],
        completed: [
            {
                id: 3,
                parkingName: "Downtown Parking",
                spotNumber: "C-789",
                startTime: "2025-02-20T09:00:00",
                endTime: "2025-02-20T17:00:00",
                price: "40.00",
                status: "completed"
            },
            {
                id: 4,
                parkingName: "Station Parking",
                spotNumber: "D-101",
                startTime: "2025-02-15T12:00:00",
                endTime: "2025-02-15T14:00:00",
                price: "10.00",
                status: "completed"
            }
        ]
    };

    const formatDateTime = (dateString) => {
        const date = new Date(dateString);
        return date.toLocaleString('en-US', {
            month: 'short',
            day: 'numeric',
            year: 'numeric',
            hour: 'numeric',
            minute: 'numeric',
            hour12: true
        });
    };

    const getStatusColor = (status) => {
        switch (status) {
            case 'active':
                return 'status-active';
            case 'upcoming':
                return 'status-upcoming';
            case 'completed':
                return 'status-completed';
            default:
                return '';
        }
    };

    return (
        <div className="page-container">
            <Header />
            <div className="content-container">
                <div className="booking-history">
                    <h1>Booking History</h1>

                    <div className="tabs">
                        <button 
                            className={`tab ${activeTab === 'active' ? 'active' : ''}`}
                            onClick={() => setActiveTab('active')}
                        >
                            Active
                        </button>
                        <button 
                            className={`tab ${activeTab === 'upcoming' ? 'active' : ''}`}
                            onClick={() => setActiveTab('upcoming')}
                        >
                            Upcoming
                        </button>
                        <button 
                            className={`tab ${activeTab === 'completed' ? 'active' : ''}`}
                            onClick={() => setActiveTab('completed')}
                        >
                            Completed
                        </button>
                    </div>

                    <div className="bookings-list">
                        {bookings[activeTab].map(booking => (
                            <div key={booking.id} className="booking-card">
                                <div className="booking-header">
                                    <h3>{booking.parkingName}</h3>
                                    <span className={`status-badge ${getStatusColor(booking.status)}`}>
                                        {booking.status.charAt(0).toUpperCase() + booking.status.slice(1)}
                                    </span>
                                </div>

                                <div className="booking-details">
                                    <div className="detail-row">
                                        <span className="label">Spot Number:</span>
                                        <span>{booking.spotNumber}</span>
                                    </div>
                                    <div className="detail-row">
                                        <span className="label">Start Time:</span>
                                        <span>{formatDateTime(booking.startTime)}</span>
                                    </div>
                                    <div className="detail-row">
                                        <span className="label">End Time:</span>
                                        <span>{formatDateTime(booking.endTime)}</span>
                                    </div>
                                    <div className="detail-row">
                                        <span className="label">Total Price:</span>
                                        <span>${booking.price}</span>
                                    </div>
                                </div>

                                <div className="booking-actions">
                                    {booking.status === 'active' && (
                                        <Link to={`/extend/${booking.id}`} className="primary-button">
                                            Extend Time
                                        </Link>
                                    )}
                                    <Link to={`/parking/${booking.id}`} className="secondary-button">
                                        View Details
                                    </Link>
                                </div>
                            </div>
                        ))}

                        {bookings[activeTab].length === 0 && (
                            <div className="empty-state">
                                <div className="empty-icon">üìù</div>
                                <h3>No {activeTab} bookings</h3>
                                <p>When you make a booking, it will appear here.</p>
                                <Link to="/search" className="primary-button">
                                    Find Parking
                                </Link>
                            </div>
                        )}
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

export default BookingHistory;
